overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n        &lt;h2&gt; Duration: 94.14 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 2396 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 459.50 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 3.12 s &lt;/li&gt;\n&lt;li&gt; transfer time: 257.09 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.4.184:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 8 &lt;/li&gt;\n          &lt;li&gt; Threads: 192 &lt;/li&gt;\n          &lt;li&gt; Memory: 1.35 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\n# import h5py\nfrom dask_ml.decomposition import InSituIncrementalPCA\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\narrays.validate_contract()\n\n\nt = time.perf_counter()\n\nwith performance_report(filename=\"dask-report.html\"):\n        pca=InSituIncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n        print(\"pca, \", pca, flush=True)\n        l = pca.fit(gt, [\"t\", \"X\", \"Y\"], [\"X\"], [\"Y\"]) \n        #cpt = [pca.mean_ , pca.var_ , pca.components_ , pca.explained_variance_ , pca.explained_variance_ratio_ , pca.singular_values_ ]\n        # Submit the task graph to the scheduler\n        cpt = [ pca.explained_variance_ , pca.singular_values_]\n        explained_variance ,singular_values  = client.persist(cpt)\n        explained_variance , singular_values = client.compute([explained_variance ,singular_values])    \n        print(\"explained_variance ,singular_values: \", explained_variance.result(), \" and \" , singular_values.result(), flush=True)\nprint(\"Done in :\", time.perf_counter() - t, flush=True)\n\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1191","type":"CategoricalScale"},{"attributes":{"source":{"id":"1213"}},"id":"1279","type":"CDSView"},{"attributes":{"below":[{"id":"1226"}],"center":[{"id":"1229"},{"id":"1233"},{"id":"1247"}],"height":150,"left":[{"id":"1230"}],"renderers":[{"id":"1245"}],"sizing_mode":"stretch_both","title":{"id":"1217"},"toolbar":{"id":"1237"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1222"},"y_range":{"id":"1220"},"y_scale":{"id":"1224"}},"id":"1216","subtype":"Figure","type":"Plot"},{"attributes":{"fill_color":{"value":"blue"},"hatch_color":{"value":"blue"},"height":{"value":0.9},"line_color":{"value":"blue"},"width":{"field":"bandwidth"},"x":{"field":"bandwidth-half"},"y":{"field":"type"}},"id":"1202","type":"Rect"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"axis":{"id":"1193"},"coordinates":null,"group":null,"ticker":null},"id":"1196","type":"Grid"},{"attributes":{"factors":["numpy.ndarray"]},"id":"1187","type":"FactorRange"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"coor
